import react from "react";
import { ReactDOM } from "react";
import Header3 from "./header3";

function Header(){
    return(
        <div className="app">
        <Header3/>
        </div>
    )
}

document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
      <Header/>,
      document.getElementById('header3')
    )
    })
